mefSoamLmCfgStopTimeType = MibTableColumn((1, 3, 6, 1, 4, 1, 15007, 1, 3, 1, 2, 1, 1, 20), MefSoamTcOperationTimeType().clone('none')).setMaxAccess("readcreate")
